'havok/widget/_AffixMixin':function(){
define([
    'dojo/_base/declare',
    'dojo/_base/lang',
    'dojo/on',
    'dojo/dom',
    'dojo/dom-geometry',
    'dojo/dom-class'
],
function(
    declare,
    lang,
    on,
    dom,
    domGeom,
    domClass
) {
    // module:
    //		havok/widget/Affix

    return declare(
        [],
        {
            affix: true,

            //affixTarget: undefined,

            viewportOffset: {
                top: 0,
                bottom: 0
            },

            //_affixScrollSignal: undefined,

            startup: function(){
                this.inherited(arguments);
                if (!this.affixTarget){
                    this.affixTarget = this.domNode.parentElement;
                }
                this.updateAffix();
            },

            _setAffixAttr: function(value){
                if (value){
                    this._affixScrollSignal = on(window, 'scroll', lang.hitch(this, 'updateAffix'));
                } else if (this._affixScrollSignal){
                    this._affixScrollSignal.remove();
                    delete(this._affixScrollSignal);
                }
                this._set('affix', value);
            },

            _setAffixTargetAttr: function(value){
                if (typeof value == 'string'){
                    value = dom.byId(value);
                }
                this._set('affixTarget', value);
            },

            _getAffixTargetAttr: function(){
                return this.affixTarget;
            },

            updateAffix: function(){
                var scrollTop = domGeom.docScroll().y,
                    targetNodePos = domGeom.position(this.get('affixTarget'), true),
                    domNodePos = domGeom.position(this.domNode, true),
                    offsetTop,
                    offsetBottom,
                    add,
                    remove;

                if (typeof this.viewportOffset.top == 'function'){
                    offsetTop = this.viewportOffset.top();
                } else {
                    offsetTop = this.viewportOffset.top;
                }
                if (typeof this.viewportOffset.bottom == 'function'){
                    offsetBottom = this.viewportOffset.bottom();
                } else {
                    offsetBottom = this.viewportOffset.bottom;
                }

                if (targetNodePos.y - scrollTop - offsetTop > 0){
                    add = 'affix-top';
                    remove = 'affix affix-bottom';
                } else if (scrollTop + offsetTop + domNodePos.h + offsetBottom - targetNodePos.y - targetNodePos.h > 0){
                    add = 'affix-bottom';
                    remove = 'affix affix-top';
                } else {
                    add = 'affix';
                    remove = 'affix-top affix-bottom';
                }

                domClass.add(this.domNode, add);
                domClass.remove(this.domNode, remove);
            },

            destroy: function(){
                if (this._affixScrollSignal){
                    this._affixScrollSignal.remove();
                }
                this.inherited(arguments);
            }
        }
    );
});

},
'havok/widget/Dragable':function(){
define([
    'dojo/_base/declare',
    'dojo/_base/lang',
    'dojo/query',
    'dojo/dom-attr',
    'dojo/dom-class',
    'dojo/on',
    'dijit/registry',
    'dijit/_WidgetBase',
    '../get!./dragData',
    '../less!./less/dragable.less'
],
function (
    declare,
    lang,
    query,
    domAttr,
    domClass,
    on,
    registry,
    WidgetBase,
    dragData
){
    // module:
    //		havok/widget/Dragable

    return declare(
        [WidgetBase],
        {
            //grip: undefined,

            //dragging: false,

            startup: function(){

                this.inherited(arguments);

                query('[data-dojo-attach-point]', this.domNode).forEach(lang.hitch(this, function(attachNode){
                    if (registry.getEnclosingWidget(attachNode) === this){
                        this[domAttr.get(attachNode, 'data-dojo-attach-point')] = attachNode;
                    }
                }));
                if (!this.grip){
                    this.grip = this.domNode;
                }

                domClass.add(this.grip, 'grip');
                this.events = [
                    on(this.domNode, 'dragstart', lang.hitch(this, 'dragstart')),
                    on(this.domNode, 'dragend', lang.hitch(this, 'dragend'))
                ];

                if (this.grip !== this.domNode){
                    this.events.push(on(this.grip, 'mousedown', lang.hitch(this, 'mousedown')))
                } else {
                    domAttr.set(this.domNode, 'draggable', true);
                }
            },

            mousedown: function(e){
                domAttr.set(this.domNode, 'draggable', true);
            },

            dragstart: function(e){
                domClass.add(this.domNode, 'dragging');

                e.dataTransfer.effectAllowed = 'move';
                dragData['application/widget'] = this.id;
                dragData['text/html'] = this.domNode.outerHTML;
                e.dataTransfer.setData('application/widget', this.id);
                e.dataTransfer.setData('text/html', this.domNode.outerHTML);

                this.set('dragging', true);
            },

            dragend: function(e){
                domClass.remove(this.domNode, 'dragging');
                if (this.grip !== this.domNode){
                    domAttr.remove(this.domNode, 'draggable', false);
                }
                delete(dragData['application/widget']);
                delete(dragData['text/html']);

                this.set('dragging', false);
            },

            destroy: function(){
                while (this.events.length > 0){
                    this.events.pop().remove();
                }
                this.inherited(arguments);
            }
        }
    );
});

},
