'havok/docs/module/Formspy':function(){
define([
    'dojo/_base/declare',
    'dojo/_base/lang',
    'dojo/json',
    '../../widget/_WidgetBase',
    'dojo/text!./template/Formspy.html'
],
function (
    declare,
    lang,
    json,
    WidgetBase,
    template
){
    // module:
    //    	havok/docs/module/Formspy

    return declare(
        [WidgetBase],
        {
            templateString: template,

            startup: function(){

                var target = this.getChildren()[0];

                this.state.innerHTML = target.get('state');
                target.watch('state', lang.hitch(this, function(property, oldValue, newValue){
                    this.state.textContent = newValue;
                }));

                this.value.innerHTML = json.stringify(target.get('value'), null, '   ');
                target.watch('value', lang.hitch(this, function(property, oldValue, newValue){
                    if (typeof newValue == 'string'){
                        this.value.textContent = newValue;
                    } else {
                        this.value.innerHTML = json.stringify(newValue, null, '   ');
                    }
                }));
            }
        }
    );
});

},
'havok/docs/module/Controller':function(){
define([
    'dojo/_base/declare',
    'dojo/_base/lang',
    'dojo/_base/array',
    'dojo/request/xhr',
    'dojo/query',
    'dojo/dom',
    'dojo/Deferred',
    'dojo/dom-construct',
    'dojo/parser',
    'dijit/registry',
    '../../exception/Application'
],
function(
    declare,
    lang,
    array,
    xhr,
    query,
    dom,
    Deferred,
    domConstruct,
    parser,
    registry,
    Application
){
    return declare([],
        {
            type: 'html',

            //node: undefined,

            constructor: function(){
                this.node = dom.byId('contentWrapper');
                this.cache = {};
            },

            go: function(){
                //if the node is full, it must be first load
                if (this.node.children.length > 0){
                    return;
                }

                var href = window.location.href;
                if (href.slice(-1) == '/'){
                    //default to index.<type>
                    href = href + 'index.html';
                }

                this.load(href.replace('.html', '-content.' + this.type)).then(lang.hitch(this, function(html){
                    this.node.innerHTML = html;
                    prettyPrint();

                    //parse the new content
                    parser.parse(this.node).then(lang.hitch(this, function(){
                        //run any embedded scripts - shouldn't have any in a production site, but the docs examples do use them
                        query('SCRIPT', this.node).forEach(function(node){
                            eval.call(window, node.innerHTML);
                        });

                        //hide overlay
                        registry.byId('contentWrapperOverlay').hide();
                    }))
                }))
            },

            exit: function(){
                array.forEach(registry.findWidgets(this.node), function(widget){
                    widget.destroyRecursive()
                });
                domConstruct.empty(this.node);
                registry.byId('contentWrapperOverlay').show();
            },

            load: function(src){

                var result = new Deferred;
                if (this.cache[src]){
                    result.resolve(this.cache[src]);
                } else {
                    xhr(src, {}).then(lang.hitch(this, function(data){
                        // Do something with the handled data
                        this.cache[src] = data;
                        result.resolve(data);
                    }), function(err){
                        // Handle the error condition
                        throw new Application('404 page not found');
                    });
                }

                return result;
            }
        }
    );
});

},
